import React from 'react';
import ImgMediaCard1 from '../components/ArtDesign/card';
import { motion } from 'framer-motion';

const Main = () => {
  return (
    <div>
      <motion.div
        className="title"
        initial={{ y: -250 }}
        animate={{ y: -30 }}
        transition={{ delay: 0.2, type: 'spring' }}>
        <h1 className="h1Main">Выберите оператора</h1>
      </motion.div>
      <div className="contentMain">
        <div>
          <ImgMediaCard1
            path="/Form/1"
            alt="MTC"
            image="https://static.ssl.mts.ru/mts_rf/images/MTS_Logo_rus_r.png"
          />
        </div>
        <div>
          <ImgMediaCard1
            path="/Form/2"
            alt="BEELINE"
            image="https://zg-brand.ru/images/Istoria_Brenda/9.png"
          />
        </div>
        <div>
          <ImgMediaCard1
            path="/Form/3"
            alt="MEGAPHONE"
            image="https://worldskills2019.com/application/files/5115/6449/4534/megafon.png"
          />
        </div>
      </div>
    </div>
  );
};

export default Main;
